import './styles/App.css';
import './styles/parallax.css';

function App() {

	return (
    <div class="main">
      <img src="./media/background3.jpg"/>
      <div class="parallax">
        <div class="parallax-layer parallax-layer--back">
          <img src="./media/background3.jpg"/>
        </div>
        <div class="parallax-layer parallax-layer--base">

        </div>
      </div>
    </div>
	);
}

export default App;
